import React, { Component } from 'react';
import {Link } from "react-router-dom";
import './RecommendProg.css';
import RecommendPrograms from "../RecommendPrograms";
import { Col,Row, Container , Image, Jumbotron, Button, Card} from "react-bootstrap";

class RecommendProg extends Component{



  render(){


      return(
          <>
            <div>

             <h1 className = "edu-navbar-logo">
             <i className = "fas fa-graduation-cap edu-cap"></i>
                 <p className= "edu-navbar-p">Study Program</p><p className="edu-navbar-p">Recommendation</p><p className="edu-navbar-p">System
             </p></h1>




           </div>


<Container>

  <h1 className= "recprog-header">Recommend Programs Results</h1>
  <Col>
    <div class="recprog-box">
        <h2 
        className="recprog-result"
        >Possible Programs</h2>
            <br></br>
            <ul>

          <div>
                {
                  RecommendPrograms.RecommendProgList.map((RecInfo) => {
                    return (
                      <div>
                        <Row className= "recprog-proglist"  >{RecInfo.Programs}</Row>
                          {
                            RecInfo.ProgramList.map((RecDetail) => {
                              return (
                                <Row className="recprog-recscore">
                                    {RecDetail.RecProgScore}
                                </Row>
                              );
                            }) 

                         }



                      </div>
                    );
                  })
                } 
            </div>

              </ul>
              </div>



            <Row>
              <Link to="/Test">
                <Button className="recprog-done-button">
                  Done
                </Button>
                </Link>
              </Row>
          </Col>
        </Container>
          </>
      )
  }
}

export default RecommendProg;
